const EXAM_CONFIG = {
    totalQuestions: 15,
    objectiveCount: 10,
    subjectiveCount: 5,
    encryptionKey: 'ExamSecure2025!@#$%'
};

// ==================== PROGRESSIVE DECRYPTION SYSTEM ====================
class SecureExamManager {
    constructor() {
        this.selectedQuestions = [];
        this.currentIndex = 0;
        this.decryptedCache = new Map();
    }

    // Decrypt a single question
    _decrypt(encryptedStr) {
        try {
            const decrypted = CryptoJS.AES.decrypt(encryptedStr, EXAM_CONFIG.encryptionKey);
            return JSON.parse(decrypted.toString(CryptoJS.enc.Utf8));
        } catch (e) {
            console.error('Decryption failed:', e);
            return null;
        }
    }

    // Select random questions
    initializeExam() {
        console.log(' Selecting random questions...');

        // Combine all encrypted MCQ
        const allMCQ = [...ENC_DATA.mcq.python, ...ENC_DATA.mcq.sql];

        // Combine all encrypted subjective
        const allSubjective = [...ENC_DATA.subjective.python, ...ENC_DATA.subjective.sql];

        // Shuffle and select
        const selectedMCQ = this._shuffleArray(allMCQ).slice(0, EXAM_CONFIG.objectiveCount);
        const selectedSubjective = this._shuffleArray(allSubjective).slice(0, EXAM_CONFIG.subjectiveCount);

        // Store encrypted questions
        this.selectedQuestions = [...selectedMCQ, ...selectedSubjective];

        console.log(` Selected ${this.selectedQuestions.length} encrypted questions`);
        return this.selectedQuestions.length;
    }

    // Fisher-Yates shuffle
    _shuffleArray(array) {
        const shuffled = [...array];
        for (let i = shuffled.length - 1; i > 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [shuffled[i], shuffled[j]] = [shuffled[j], shuffled[i]];
        }
        return shuffled;
    }

    // Get current question (decrypted)
    getCurrentQuestion() {
        // Check cache first
        if (this.decryptedCache.has(this.currentIndex)) {
            return this.decryptedCache.get(this.currentIndex);
        }

        // Decrypt current question
        const encrypted = this.selectedQuestions[this.currentIndex];
        if (!encrypted) return null;

        const decrypted = this._decrypt(encrypted);

        // Cache only current question
        this.decryptedCache.clear(); // Clear all previous
        this.decryptedCache.set(this.currentIndex, decrypted);

        return decrypted;
    }

    // Navigation
    nextQuestion() {
        if (this.currentIndex < this.selectedQuestions.length - 1) {
            this.currentIndex++;
            return this.getCurrentQuestion();
        }
        return null;
    }

    previousQuestion() {
        if (this.currentIndex > 0) {
            this.currentIndex--;
            return this.getCurrentQuestion();
        }
        return null;
    }

    goToQuestion(index) {
        if (index >= 0 && index < this.selectedQuestions.length) {
            this.currentIndex = index;
            return this.getCurrentQuestion();
        }
        return null;
    }

    getTotalQuestions() {
        return this.selectedQuestions.length;
    }
}

// ==================== INITIALIZATION ====================
function initializeExamSystem() {
    console.log(' Initializing secure exam system...');
    window.examManager = new SecureExamManager();
    const total = window.examManager.initializeExam();
    console.log(` Exam system ready with ${total} encrypted questions`);
    return window.examManager;
}
